import gql from "graphql-tag";
const GET_AD_SELL_LEASE_COMMENTS = gql`
  query adSellLeaseComments($page: Int!, $limit: Int!, $filter: String!) {
    adSellLeaseComments(page: $page, limit: $limit, filter: $filter) {
      edges {
        node {
          id
          ad_sell_lease_id
          content
          user_id
          media
          user {
            first_name
            last_name
            avatar
          }
          like_number
          created_at
        }
      }
    }
  }
`;

const GET_AD_SELL_LEASE_RATING = gql`
  query adSellLeaseRatings ($page: Int!, $limit: Int!, $filter: String!) {
    adSellLeaseRatings(page: $page, limit: $limit, filter: $filter) {
      edges {
        node {
          id
          ad_sell_lease_id
          content
          user_id
          media
          user {
            first_name
            last_name
            avatar
          }
          rate
          like_number
          created_at
        }
      }
    }
  }
`;

export {
  GET_AD_SELL_LEASE_COMMENTS,
  GET_AD_SELL_LEASE_RATING
}
